    requires:
      URI::Escape: 0
  Bio::Tree::Compatible:
    description: proper operation
    requires:
      Set::Scalar: 0
  Bio::TreeIO::svggraph:
    description: creating SVG images
    requires:
      SVG::Graph: 0.01
  'Bio::Variation::IO::xml,Bio::DB::Taxonomy::entrez,Bio::DB::Biblio::eutils,Bio::Graph::IO::psi_xml':
    description: parsing xml
    requires:
      XML::Twig: 0
  'XML::DOM::XPath,Bio::FeatureIO::interpro':
    description: parsing xml
    requires:
      XML::XPath: 0
  'XML::Simple,Bio::DB::EUtilities':
    description: parsing xml
    requires:
      XML::SAX::ExpatXS: 0
